import { useSelector } from "react-redux";
import { styled } from "styled-components";
import Tower from "../Tower";

const TowerImage = styled.img`
    position: absolute;
    height: 80px;
`;

export default function Floor({team, index}){

    const status = useSelector(state => state.status[team])

    return (
            <TowerImage src={require("../../../assets/images/towers/level" + status.level + "/" + (Number(index) + 1) + ".png")}></TowerImage>
    )
}
